  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	title: '对接 Keycloak (SAML)',
	description: '如果您的组织使用 Keycloak Identity Provider (IdP)进行用户身份验证，您可以配置 Rancher 来允许您的用户使用他们的 IdP 凭证登录。',
	keywords: [
		'rancher 2.0中文文档',
		'rancher 2.x 中文文档',
		'rancher中文',
		'rancher 2.0中文',
		'rancher2',
		'rancher教程',
		'rancher中国',
		'rancher 2.0',
		'rancher2.0 中文教程',
		'系统管理员指南',
		'登录认证',
		'对接 Keycloak (SAML)'
	]
};
export const metadata = {
  "id": "rancher2/admin-settings/authentication/keycloak/_index",
  "title": "对接 Keycloak (SAML)",
  "description": "如果您的组织使用 Keycloak Identity Provider (IdP)进行用户身份验证，您可以配置 Rancher 来允许您的用户使用他们的 IdP 凭证登录。",
  "source": "@site/docs/rancher2/admin-settings/authentication/keycloak/_index.md",
  "permalink": "/docs/rancher2/admin-settings/authentication/keycloak/_index",
  "editUrl": "https://github.com/cnrancher/docs-rancher2/edit/master/docs/rancher2/admin-settings/authentication/keycloak/_index.md",
  "lastUpdatedBy": "Author",
  "lastUpdatedAt": 1539502055
};
  /* @jsx mdx */

export const rightToc = [{
  value: '先决条件',
  id: '先决条件',
  children: []
}, {
  value: '在 Rancher 中配置 Keycloak',
  id: '在-rancher-中配置-keycloak',
  children: []
}, {
  value: '附录: 故障诊断',
  id: '附录-故障诊断',
  children: [{
    value: '没有被重定向到 Keycloak',
    id: '没有被重定向到-keycloak',
    children: []
  }, {
    value: 'IdP 登录后显示禁止消息',
    id: 'idp-登录后显示禁止消息',
    children: []
  }, {
    value: '在访问 <code>/v1-saml/keycloak/saml/metadata</code> 时返回 HTTP 502',
    id: '在访问-v1-samlkeycloaksamlmetadata-时返回-http-502',
    children: []
  }, {
    value: 'Keycloak 错误: &quot;We&#39;re sorry, failed to process response&quot;',
    id: 'keycloak-错误-were-sorry-failed-to-process-response',
    children: []
  }, {
    value: 'Keycloak 错误: &quot;We&#39;re sorry, invalid requester&quot;',
    id: 'keycloak-错误-were-sorry-invalid-requester',
    children: []
  }]
}];
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p><em parentName="p">{`v2.1.0 版本可用`}</em></p>
    <p>{`如果您的组织使用 Keycloak Identity Provider (IdP)进行用户身份验证，您可以配置 Rancher 来允许您的用户使用他们的 IdP 凭证登录。`}</p>
    <h2 {...{
      "id": "先决条件"
    }}>{`先决条件`}</h2>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`您必须有一个`}<a parentName="p" {...{
            "href": "https://www.keycloak.org/docs/latest/server_installation/"
          }}>{`Keycloak IdP 服务器`}</a>{`。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`在 Keycloak 中，创建一个新的 SAML 客户端，设置如下。参见`}<a parentName="p" {...{
            "href": "https://keycloak.org/docs/latest/server_admin/#saml-clients"
          }}>{`Keycloak 文档`}</a>{`获得帮助。`}</p>
        <table parentName="li">
          <thead parentName="table">
            <tr parentName="thead">
              <th parentName="tr" {...{
                "align": "left"
              }}>{`设置`}</th>
              <th parentName="tr" {...{
                "align": "left"
              }}>{`值`}</th>
            </tr>
          </thead>
          <tbody parentName="table">
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}><inlineCode parentName="td">{`Sign Documents`}</inlineCode></td>
              <td parentName="tr" {...{
                "align": "left"
              }}><inlineCode parentName="td">{`ON`}</inlineCode>{` `}<sup>{`1`}</sup></td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}><inlineCode parentName="td">{`Sign Assertions`}</inlineCode></td>
              <td parentName="tr" {...{
                "align": "left"
              }}><inlineCode parentName="td">{`ON`}</inlineCode>{` `}<sup>{`1`}</sup></td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`所有其它`}<inlineCode parentName="td">{`ON/OFF`}</inlineCode>{`设置`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}><inlineCode parentName="td">{`OFF`}</inlineCode></td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}><inlineCode parentName="td">{`Client ID`}</inlineCode></td>
              <td parentName="tr" {...{
                "align": "left"
              }}><inlineCode parentName="td">{`https://yourRancherHostURL/v1-saml/keycloak/saml/metadata`}</inlineCode><sup>{`2`}</sup></td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}><inlineCode parentName="td">{`Client Name`}</inlineCode></td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`<CLIENT_NAME> (e.g. `}<inlineCode parentName="td">{`rancher`}</inlineCode>{`)`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}><inlineCode parentName="td">{`Client Protocol`}</inlineCode></td>
              <td parentName="tr" {...{
                "align": "left"
              }}><inlineCode parentName="td">{`SAML`}</inlineCode></td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}><inlineCode parentName="td">{`Valid Redirect URI`}</inlineCode></td>
              <td parentName="tr" {...{
                "align": "left"
              }}><inlineCode parentName="td">{`https://yourRancherHostURL/v1-saml/keycloak/saml/acs`}</inlineCode></td>
            </tr>
          </tbody>
        </table>
        <blockquote parentName="li">
          <ul parentName="blockquote">
            <li parentName="ul">{`1：您可以选择启用这些设置中的一个或两个。`}</li>
            <li parentName="ul">{`2：在配置和保存 SAML 提供者之前，不会生成 Rancher SAML 元数据。
`}<img parentName="li" {...{
                "src": "/img/rancher/keycloak-saml-client-configuration.png",
                "alt": "keycloak-saml-client-configuration"
              }}></img></li>
          </ul>
        </blockquote>
        <p parentName="li">{`在新的 SAML 客户端中，创建 Mappers 来暴露用户字段。`}</p>
        <ul parentName="li">
          <li parentName="ul">{`添加所有 "内置协议映射器"
`}<img parentName="li" {...{
              "src": "/img/rancher/keycloak-saml-client-builtin-mappers.png",
              "alt": "keycloak-saml-client-builtin-mappers"
            }}></img></li>
          <li parentName="ul">{`创建一个新的 "组列表 "映射器，将成员属性映射到用户的组。
`}<img parentName="li" {...{
              "src": "/img/rancher/keycloak-saml-client-group-mapper.png",
              "alt": "keycloak-saml-client-group-mapper"
            }}></img></li>
        </ul>
      </li>
      <li parentName="ul">
        <p parentName="li">{`从 Keycloak 客户端导出`}<inlineCode parentName="p">{`metadata.xml`}</inlineCode>{`文件：
在`}<inlineCode parentName="p">{`安装`}</inlineCode>{`选项卡中，选择`}<inlineCode parentName="p">{`SAML Metadata IDPSSODescriptor`}</inlineCode>{`格式选项并下载文件。`}</p>
      </li>
    </ul>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`说明：`}</strong>{`
Keycloak 6.0.0 及以上版本不再在 "安装 "标签下提供 IDP 元数据。
你仍然可以从以下网址获取 XML：`}</p>
      <p parentName="blockquote"><inlineCode parentName="p">{`https://{KEYCLOAK-URL}/auth/realms/{REALM-NAME}/protocol/saml/descriptor`}</inlineCode></p>
      <p parentName="blockquote">{`从这个 URL 获得的 XML 包含`}<inlineCode parentName="p">{`EntitiesDescriptor`}</inlineCode>{`作为根元素。Rancher 希望根元素是`}<inlineCode parentName="p">{`EntityDescriptor`}</inlineCode>{`而不是`}<inlineCode parentName="p">{`EntitiesDescriptor`}</inlineCode>{`。因此，在将这个 XML 传递给 Rancher 之前，请按照以下步骤调整：`}</p>
      <ul parentName="blockquote">
        <li parentName="ul">{`将`}<inlineCode parentName="li">{`EntitiesDescriptor`}</inlineCode>{`中所有不存在的属性复制到 `}<inlineCode parentName="li">{`EntityDescriptor`}</inlineCode>{`中。`}</li>
        <li parentName="ul">{`删除开头的`}<inlineCode parentName="li">{`<EntitiesDescriptor>`}</inlineCode>{`标签。`}</li>
        <li parentName="ul">{`删除结尾的的`}<inlineCode parentName="li">{`</EntitiesDescriptor>`}</inlineCode>{`。`}</li>
      </ul>
      <p parentName="blockquote">{`完成后，会留下类似下面的代码：`}</p>
      <pre parentName="blockquote"><code parentName="pre" {...{}}>{`<EntityDescriptor xmlns="urn:oasis:names:tc:SAML:2.0:metadata" xmlns:dsig="http://www.w3.org/2000/09/xmldsig#" entityID="https://{KEYCLOAK-URL}/auth/realms/{REALM-NAME}">
  ....
</EntityDescriptor>
`}</code></pre>
    </blockquote>
    <h2 {...{
      "id": "在-rancher-中配置-keycloak"
    }}>{`在 Rancher 中配置 Keycloak`}</h2>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`在`}<strong parentName="p">{`全局`}</strong>{`视图中，从主菜单中选择`}<strong parentName="p">{`安全 > 认证`}</strong>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`选择`}<strong parentName="p">{`Keycloak`}</strong>{`。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`完成`}<strong parentName="p">{`配置 Keycloak 帐户`}</strong>{`表单。`}</p>
        <table parentName="li">
          <thead parentName="table">
            <tr parentName="thead">
              <th parentName="tr" {...{
                "align": "left"
              }}>{`字段`}</th>
              <th parentName="tr" {...{
                "align": "left"
              }}>{`描述`}</th>
            </tr>
          </thead>
          <tbody parentName="table">
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`显示名称`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`包含用户 display name 的 属性，例如`}<inlineCode parentName="td">{`givenName`}</inlineCode></td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`用户名`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`包含用户 user name/given name 的属性，例如`}<inlineCode parentName="td">{`givenName`}</inlineCode></td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`UID`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`对每个用户唯一的属性，例如`}<inlineCode parentName="td">{`email`}</inlineCode></td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`组`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`为管理组成员身份创建的组，例如`}<inlineCode parentName="td">{`team_member`}</inlineCode></td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`Rancher API 地址`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`Rancher Server 的 URL 地址`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`私钥 / 证书`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`密钥/证书对，用于在 Rancher 和 IdP 之间创建安全 shell`}</td>
            </tr>
            <tr parentName="tbody">
              <td parentName="tr" {...{
                "align": "left"
              }}>{`元数据 XML`}</td>
              <td parentName="tr" {...{
                "align": "left"
              }}>{`从您的 IdP 服务器导出的`}<inlineCode parentName="td">{`metadata.xml`}</inlineCode>{`文件。`}</td>
            </tr>
          </tbody>
        </table>
        <blockquote parentName="li">
          <p parentName="blockquote"><strong parentName="p">{`提示：`}</strong>{` 您可以使用 openssl 命令生成密钥/证书对。例如：`}</p>
          <pre parentName="blockquote"><code parentName="pre" {...{}}>{`   openssl req -x509 -sha256 -nodes -days 365 -newkey rsa:2048 -keyout myservice.key -out myservice.cert
`}</code></pre>
        </blockquote>
      </li>
      <li parentName="ol">
        <p parentName="li">{`完成`}<strong parentName="p">{`配置 Keycloak 帐户`}</strong>{`表单后，单击页面底部的`}<strong parentName="p">{`启用 Keycloak 认证`}</strong>{`进行身份验证。`}</p>
        <p parentName="li">{`Rancher 将重定向到 IdP 登录页面。输入 Keycloak IdP 系统的身份验证凭据，以验证您的 Rancher Keycloak 配置。`}</p>
        <blockquote parentName="li">
          <p parentName="blockquote"><strong parentName="p">{`注：`}</strong>{` 您可能需要禁用弹出窗口拦截器以访问 IdP 登录页面。`}</p>
        </blockquote>
      </li>
    </ol>
    <p><strong parentName="p">{`结果：`}</strong>{` Rancher 被配置为使用 Keycloak 认证。您的用户现在可以使用 Keycloak 账号登录 Rancher。`}</p>
    <blockquote>
      <p parentName="blockquote">{`SAML 身份验证提供者警告：`}</p>
      <ul parentName="blockquote">
        <li parentName="ul">{`SAML 协议不支持搜索或查找用户或组。因此，将用户或组添加到 Rancher 时不会对其进行验证。`}</li>
        <li parentName="ul">{`添加用户时，必须正确输入确切的用户 ID（即`}<inlineCode parentName="li">{`UID`}</inlineCode>{`字段）。输入用户 ID 时，将不会搜索可能匹配的其他用户 ID。`}</li>
        <li parentName="ul">{`添加组时，必须从文本框旁边的下拉列表中选择组。Rancher 假定来自文本框的任何输入都是用户。`}<ul parentName="li">
            <li parentName="ul">{`用户组下拉列表仅显示您所属的用户组。您将无法添加您不是其成员的组。`}</li>
          </ul></li>
      </ul>
    </blockquote>
    <h2 {...{
      "id": "附录-故障诊断"
    }}>{`附录: 故障诊断`}</h2>
    <p>{`如果在测试到 Keycloak 服务器的连接时遇到了问题，首先需要再次检查 SAML 客户机的配置选项。您还可以检查 Rancher 日志，以帮助确定问题的原因。调试日志可能包含关于错误的更详细的信息。请参考本文档中的`}<a parentName="p" {...{
        "href": "/docs/rancher2/faq/technical/_index"
      }}>{`如何启用调试日志`}</a>{`。`}</p>
    <h3 {...{
      "id": "没有被重定向到-keycloak"
    }}>{`没有被重定向到 Keycloak`}</h3>
    <p>{`当您单击`}<strong parentName="p">{`启用 Keycloak 认证`}</strong>{`时，没有被重定向到 Keycloak IdP。`}</p>
    <ul>
      <li parentName="ul">{`验证您的 Keycloak 客户端配置。`}</li>
      <li parentName="ul">{`确保`}<inlineCode parentName="li">{`Force Post Binding`}</inlineCode>{`设置为`}<inlineCode parentName="li">{`OFF`}</inlineCode>{`。`}</li>
    </ul>
    <h3 {...{
      "id": "idp-登录后显示禁止消息"
    }}>{`IdP 登录后显示禁止消息`}</h3>
    <p>{`您被正确地重定向到 Keycloak IdP 登录页面，可以输入凭据，但得到一个`}<inlineCode parentName="p">{`禁止`}</inlineCode>{`的消息。`}</p>
    <ul>
      <li parentName="ul">{`检查 Rancher 调试日志。`}</li>
      <li parentName="ul">{`如果日志显示`}<inlineCode parentName="li">{`ERROR: either the Response or Assertion must be signed`}</inlineCode>{`，确保`}<inlineCode parentName="li">{`Sign Documents`}</inlineCode>{`或`}<inlineCode parentName="li">{`Sign assertions`}</inlineCode>{` 在您的 Keycloak 客户端中被设置为`}<inlineCode parentName="li">{`ON`}</inlineCode>{`。`}</li>
    </ul>
    <h3 {...{
      "id": "在访问-v1-samlkeycloaksamlmetadata-时返回-http-502"
    }}>{`在访问 `}<inlineCode parentName="h3">{`/v1-saml/keycloak/saml/metadata`}</inlineCode>{` 时返回 HTTP 502`}</h3>
    <p>{`这通常是由于只有在配置了 SAML 提供者之后，才会创建元数据。
尝试将 keycloak 配置并保存为您的 SAML 提供者，然后再访问元数据。`}</p>
    <h3 {...{
      "id": "keycloak-错误-were-sorry-failed-to-process-response"
    }}>{`Keycloak 错误: "We're sorry, failed to process response"`}</h3>
    <ul>
      <li parentName="ul">{`检查 Keycloak 日志。`}</li>
      <li parentName="ul">{`如果日志显示`}<inlineCode parentName="li">{`failed: org.keycloak.common.VerificationException: Client does not have a public key`}</inlineCode>{`，在 Keycloak 客户端中将`}<inlineCode parentName="li">{`Encrypt Assertions`}</inlineCode>{` 设置为`}<inlineCode parentName="li">{`OFF`}</inlineCode>{`。`}</li>
    </ul>
    <h3 {...{
      "id": "keycloak-错误-were-sorry-invalid-requester"
    }}>{`Keycloak 错误: "We're sorry, invalid requester"`}</h3>
    <ul>
      <li parentName="ul">{`检查 Keycloak 日志。`}</li>
      <li parentName="ul">{`如果日志显示`}<inlineCode parentName="li">{`request validation failed: org.keycloak.common.VerificationException: SigAlg was null`}</inlineCode>{`，在 Keycloak 客户端中将`}<inlineCode parentName="li">{`Client Signature Required`}</inlineCode>{`设置为`}<inlineCode parentName="li">{`OFF`}</inlineCode>{`。`}</li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
